import './Home.css'; // Make sure this line imports the CSS file

const Home = () => {
  return (
    <section className="home-container">
      <div className="home-content">
        <h1 className="home-title">
          Tackling the problems of today,<br /> whilst creating the leaders of tomorrow.
        </h1>
        <p className="home-subtitle">
        JOIN US TO ENGAGE THE NEXT GENERATION OF ENTREPRENEURIAL LEADERS TO USE INNOVATION AND BUSINESS TO IMPROVE THE WORLD. 
        </p>
      </div>
    </section>
  );
};

export default Home;
